var Division1Shapes = L.geoJson(null, {
  style: function (feature) {
    return {
      fillColor: Division1Colours[feature.properties.id],
      color: "#596C56",
      weight: 1.5,
      opacity: 0.5,
      fillOpacity: 0.25,
      dashArray: "4 4",
      clickable: false
    };
  },
  onEachFeature: function (feature, layer) {
    if (feature.properties) {
      var content =
        "<table class='table table-striped table-bordered table-condensed'>" +
        "<tr><th>Division</th><td>" + feature.properties.Division +
        "</td></tr>" + "<tr><th>Line</th><td>" + feature.properties.Line +
        "</td></tr>" + "<table>";
      layer.on({
        click: function (e) {
          $("#feature-title").html(feature.properties.Line);
          $("#feature-info").html(content);
          $("#featureModal").modal("show");
        }
      });
    }
    layer.on({
      mouseover: function (e) {
        var layer = e.target;
        layer.setStyle({
          weight: 3,
          color: "#00FFFF",
          opacity: 1
        });
        if (!L.Browser.ie && !L.Browser.opera) {
          layer.bringToFront();
        }
      },
      mouseout: function (e) {
        Division1Shapes.resetStyle(e.target);
      }
    });
  }
});
