// Seed the base layer, for the whole world, for zoom levels 0 through 15.
		function seed() {
			var bbox = L.latLngBounds(L.latLng(-10,50), L.latLng(-4,60));
			Esri_WorldShadedRelief.seed( bbox, 0, 10 );
		}

		// Display seed progress on console
		Esri_WorldShadedRelief.on('seedprogress', function(seedData){
			var percent = 100 - Math.floor(seedData.remainingLength / seedData.queueLength * 100);
			console.log('Seeding ' + percent + '% done');
		});
		Esri_WorldShadedRelief.on('seedend', function(seedData){
			console.log('Cache seeding complete');
		});
		
		

		
